import CourseList from './CourseList';

const Home = () => {
  const course = [
    {
      Хичээлийн_дугаар: '083b2e6c1ca8e1e03b66332fcb185636',
      Хичээлийн_индекс: 'PSYC233',
      mn_name: 'Психотерапи I',
      Англи_нэр: 'Psychotherapy I',
      Харьяалах_тэнхим: 'Боловсрол, сэтгэл судлалын тэнхим',
      Сургалтын_түвшин: 'Бакалавр',
      Багц_цаг: 3,
      Орох_улирал: 'Хаврын улирал',
      Зорилго: '',
    },
    {
      Хичээлийн_дугаар: '12ec55eacc8faf9196fe03d11b45c8a4',
      Хичээлийн_индекс: 'POLI315',
      mn_name: 'Улс төрийн бодлогын анализ',
      Англи_нэр: 'Public policy analysis',
      Харьяалах_тэнхим: 'Улс төр судлалын тэнхим',
      Сургалтын_түвшин: 'Бакалавр',
      Багц_цаг: 3,
      Орох_улирал: 'Намрын улирал',
      Зорилго:
        'Хичээлийн гол зорилго нь улс төрийн бодлогын \nанализын талаарх орчин үеийн онол, арга зүйн олон талын мэдлэг олж авахад оршино.',
    },
    {
      Хичээлийн_дугаар: '085f2436d13cb426f0a0a93ba66d33b4',
      Хичээлийн_индекс: 'POLI413',
      mn_name: 'Улс төрийн маркетинг',
      Англи_нэр: 'Political marketing',
      Харьяалах_тэнхим: 'Улс төр судлалын тэнхим',
      Сургалтын_түвшин: 'Бакалавр',
      Багц_цаг: 2,
      Орох_улирал: 'Намрын улирал',
      Зорилго:
        'Улс төр судлаач мэргэжлээр бэлтгэгдэж буй оюутнуудад улс төрийн маркетинг, түүний онцлог, ач холбогдолтой танилцуулж, маркетингийн судалгаа явуулах, хэрэглэх арга технологийг эзэмшүүлэх явдал.',
    },
  ];
  return (
    <div className='home'>
      <CourseList course={course} />
    </div>
  );
};

export default Home;
